Some of the biggest names in Celtic music come together for an unforgettable evening of entertainment in this gala concert event filmed in 1997 at the Point Theatre in Dublin, Ireland. Featured artists in this &quot;Gael Force&quot; celebration of Irish music's roots include The Chieftains, Clannad, Sinead O'Connor, De Dannan, folk singer Christy Moore, Brian Kennedy, tenor Tommy Fleming and vocalist Mary Black.
